'use strict';
let SystemPropertiesMessage = require('./SystemPropertiesMessage.js');
let string_map = require('@gehtsoft/LuaxStdlib-node').string_map;
let StringValueObject = require('./StringValueObject.js');
//@@DocBrief("The builder of the SystemPropertiesMessageBuilder class")
class SystemPropertiesMessageBuilder extends SystemPropertiesMessage {
    constructor() {
        super();
        this.data = new string_map();
    }
    setProperty(name, value) {
        this.data.set(name, StringValueObject.create(value));
    }
    build() {
        return this;
    }
}
module.exports = SystemPropertiesMessageBuilder
